import * as React from "react";
import styled from "styled-components";
export const Nav = () => {
  return (
    <StyledWrapper>
      <nav className="navbar navbar-expand-lg">
        <a className="navbar-brand" href="#">
          getfitwithme
        </a>
        <div className="collapse navbar-collapse">
          <ul className="navbar-nav ml-auto menu-items">
            <li className="nav-item">Rules</li>
            <li className="nav-item">Log In</li>
          </ul>
        </div>
      </nav>
    </StyledWrapper>
  );
};

//https://www.muscleandstrength.com/workouts/muscle-and-strength-womens-workout
//https://www.youtube.com/watch?v=dYjdzpZv5yc
//https://menubar.io/reactjs-tables
//https://www.youtube.com/watch?v=uduTSA_bkVY - make navbar to the right

const StyledWrapper = styled.div`
  .navbar {
    background-color: #e4f4fa;
    height: 40px;
    display: flex;
    justify-content: space-between;
  }
  .menu-items {
    display: flex;
  }
  .menu-items li {
    padding: 1rem;
    color: grey;
    font-size: 1.2rem;
    padding: 0.3rem;
  }

  .menu-items :hover {
    border-bottom: 2px solid #24f4fa;
  }
`;
